import React, { Component } from 'react';
import Nav from 'react-bootstrap/Nav'
import Navbar from 'react-bootstrap/Navbar'
import Form from 'react-bootstrap/Form'
import FormControl from 'react-bootstrap/FormControl'
import Button from 'react-bootstrap/Button'
import { Link } from 'react-router-dom';
import { MDBInput } from "mdbreact";
import { MDBCol, MDBIcon, MDBRow } from "mdbreact";
import { Grid, Row, Col } from 'react-bootstrap';



class Header extends Component {
  constructor(props) {
    super(props);
    this.state = {}
  }
  render() {
    return (
    <div>
        <MDBRow>
                <MDBCol size="2">
                <img src={require('./images/logo.png')} style={{ width: '120px', height: '120px' }} />               
                </MDBCol>
        </MDBRow>
        <MDBRow> 
                <MDBCol size="5">
                        <Nav className="mr-auto">
                              <Nav.Link style={{border: '1px solid'}}><Link to='/'>Home</Link></Nav.Link>
                              <Nav.Link><Link to='/products'>Products</Link></Nav.Link>
                              <Nav.Link><Link to='/events'>Events</Link></Nav.Link>
                              <Nav.Link><Link to='/jewelry-care'>Jewelry Care</Link></Nav.Link>
                              <Nav.Link><Link to='/contact'>Contact US</Link></Nav.Link>
                       </Nav>    
                </MDBCol>

                <MDBCol md="3">
                       <MDBInput hint="Search" type="text" containerClass="mt-0" />
                </MDBCol>

                <MDBCol size="2" class="social">
                     <Nav.Link>
                     <div class="middle">
                             <a class="btn" href="#"> <i class="fab fa-facebook-f"></i> </a>
                             <a class="btn" href="#"> <i class="fab fa-twitter"></i> </a>
                              <a class="btn" href="#"> <i class="fab fa-instagram"></i> </a> 
                             <a class="btn" href="#"> <i class="fab fa-youtube"></i> </a> </div>
                      </Nav.Link>           

                </MDBCol>
      </MDBRow>

      </div>  







    );
  }
}


export default Header;
